  \"2016-05-25T00:42:33.125476\",\n\t\"name\": \"knowledge-management\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This is an FHWA initiative to promote knowledge
  sharing across the organization; it includes a FHWA external Microsoft SharePoint
  2010 services, internal Microsoft SharePoint 2010 services, and Adobe Connect Professional
  Web conferencing services for knowledge sharing communities. There are two SharePoint
  environments that are not connected. The two environments are totally separate.The
  internal environment is non-Public and accessible to DOT only. The internal environment
  is managed by OST. It hosts 184 top level SharePoint sites serving the FHWA. The
  external environment is Public with some restricted SharePoint sites. External environment
  is managed by FHWA.The external SharePoint environment hosts 16 top level SharePoint
  sites serving the FHWA, state and local DOTs, and the surface transportation community.\",\n\t\"license_title\":
